export const Actiontypes = {
    ADD_ITEMS : "ADD_ITEMS",
    UPDATE_CONTACT:"UPDATE_CONTACT",
    DELETE_CONTACT:"DELETE_CONTACT", 
    ADD_MOVIES:"ADD_MOVIES"
};
 export const fetchItem = (items) =>{
     return {
       type: Actiontypes.ADD_,
       payload: items, 
     }
   };
